import { Link, useNavigate } from "react-router-dom";
import logo from "../assets/logo192.png";

const Ribbon = () => {
  const navigate = useNavigate();
  const handleLogout = () => {
    localStorage.clear();
    navigate("/users/login");
  };
  return (
    <nav className="flex gap-[8rem] justify-evenly items-center py-2 px-4">
      <Link href="/" className="text-[3rem] text-khamco-primary no-underline font-minimoBold">
        <img src={logo} alt="" style={{ width: "40%" }} />
      </Link>
      <input type="checkbox" name="topnav" id="topnav" className="hidden" />
      <label htmlFor="topnav" className="text-khamco-ribbon text-[2rem] cursor-pointer md:hidden">
        <i className="fas fa-bars"></i>
      </label>
      <label htmlFor="topnav" className="text-khamco-ribbon text-[2rem] cursor-pointer hidden">
        <i className="fas fa-times" ></i>
      </label>
      <ul className="md:flex justify-between list-none gap-[4rem] flex-wrap hidden">
        <Link to="/" className="text-white bg-khamco-ribbon py-2 px-4 rounded-2xl cursor-pointer text-[1rem]">Main Menu</Link>
      </ul>
    </nav>
  );
};

export default Ribbon;
